import React from "react";
import "../../css/Main.css";
import { HeadMenu, ListPosts } from "../../__modules__";

function App() {
  let hash = window.location.hash;
  if (hash.startsWith("#profile")) {
    return (
      <React.Fragment>
        <HeadMenu />
        <Profile />
      </React.Fragment>
    );
  }

  if (hash.startsWith("#home")) {
    return (
      <React.Fragment>
        <HeadMenu />
        <ListPosts />
      </React.Fragment>
    );
  }

  if (hash.startsWith("#search")) {
    return (
      <React.Fragment>
        <HeadMenu />
        <Search />
      </React.Fragment>
    );
  }
}

export { App };
